/* eslint-disable */
import React, { useState, useEffect } from "react";
import axios from 'axios';

import { useDispatch, useSelector } from "react-redux";
import { Helmet } from "react-helmet";
import {
  Row,
  Col,
  Image,
  ListGroup,
  Card,
  Form,
  Button,
} from "react-bootstrap";
import NumberFormat from "react-number-format";
import TablaProducts from "../components/TablaProducts";

const DetailProduct = ({ history, match }) => {
  const orderId = match.params.id
  console.log(orderId);
  // fetchData(orderId);
  const [arrList, setarrList] = useState([]);
  const [items, setItems] = useState([]);
  const [nombre, setNombre] = useState("");
  const [descripcion, setDescripcion] = useState("");
  const [precio, setPrecio] = useState("");
  const [categoria, setCategoria] = useState("");
  const [brand, setBrand] = useState("");
  const [cantidad, setCantidad] = useState("");

  const URL ="https://zpje4svosl.execute-api.us-east-1.amazonaws.com/dev/products"



  const handleSubmit = (e) => {
    e.preventDefault();

    // Validar los campos del formulario
    if (
      !nombre ||
      !descripcion ||
      !precio ||
      !categoria ||
      !brand ||
      !cantidad
    ) {
      alert("Por favor, completa todos los campos");
      return;
    }

    // Crear un nuevo objeto con los datos del formulario
    const nuevoItem = {
      name: nombre,
      description: descripcion,
      price: precio,
      category: categoria,
      brand,
      quantity: cantidad,
    };

    // Agregar el nuevo item usando la funciÃ³n pasada como prop
    agregarItem(nuevoItem);

    // Limpiar los campos del formulario
    setNombre("");
    setDescripcion("");
    setPrecio("");
    setCategoria("");
    setBrand("");
    setCantidad("");
  };
  const fetchData = async (id) => {
    try {

      // const response = await axios('/api/items'); // Use the relative path to your API endpoint
      const response = await axios(URL+"/"+id); // Use the relative path to your API endpoint
      const data = await response;
      let arr = data.data.body;
      console.log(data.data.body);

    } catch (error) {
      console.error(error);
    }
  };
  useEffect(() => {
    const fetchProduct = async () => {
      try {
        const response = await axios.get(`/api/products/${productId}`);
        setProduct(response.data);
        setName(response.data.name);
        setDescription(response.data.description);
        setPrice(response.data.price);
        setCategory(response.data.category);
        setBrand(response.data.brand);
        setQuantity(response.data.quantity);
      } catch (error) {
        console.error(error);
      }
    };

    fetchProduct();
  }, [productId]);
  const agregarItem = async (nuevoItem)=>{
    // arrList.push(obj);
    try {
      // const response = await axios('/api/items'); // Use the relative path to your API endpoint
      const response = await axios.post(URL, nuevoItem); // Use the relative path to your API endpoint
      const data = await response;
      alert(data.data.body);
      fetchData();
    } catch (error) {
      console.error(error);
    }
    console.log(arrList);
  }


  return (
    <div>

            <form className="formulario" onSubmit={handleSubmit}>
              <label className="label1" htmlFor="nombre">
                Nombre:
              </label>
              <input
                className="input1"
                type="text"
                id="nombre"
                value={nombre}
                onChange={(e) => setNombre(e.target.value)}
              />

              <label className="label1" htmlFor="descripcion">
                DescripciÃ³n:
              </label>
              <input
                className="input1"
                type="text"
                id="descripcion"
                value={descripcion}
                onChange={(e) => setDescripcion(e.target.value)}
              />

              <label className="label1" htmlFor="precio">
                Precio:
              </label>
              <input
                className="input1"
                type="number"
                id="precio"
                value={precio}
                onChange={(e) => setPrecio(e.target.value)}
              />

              <label className="label1" htmlFor="categoria">
                CategorÃ­a:
              </label>
              <input
                className="input1"
                type="text"
                id="categoria"
                value={categoria}
                onChange={(e) => setCategoria(e.target.value)}
              />

              <label className="label1" htmlFor="brand">
                Marca:
              </label>
              <input
                className="input1"
                type="text"
                id="brand"
                value={brand}
                onChange={(e) => setBrand(e.target.value)}
              />

              <label className="label1" htmlFor="cantidad">
                Cantidad:
              </label>
              <input
                className="input1"
                type="number"
                id="cantidad"
                value={cantidad}
                onChange={(e) => setCantidad(e.target.value)}
              />

              <button className="button1" type="submit">
                Editar
              </button>
            </form>
            {/* <div className="container d-flex justify-center mt-2">
              <TablaProducts products={items} />
            </div> */}


    </div>
  );
};

export default DetailProduct;
